const Friendship = () => {
  const friendship = {
    friends: false,
    following: false,
    requestSent: false,
    requestReceived: false,
  };

  return;
  friendship.friends ? (
    <div className="friends_menu_wrap">
      <button className="gray_btn">
        <img src="../../../friends.png" alt="" />
        <span>Friends</span>
      </button>
    </div>
  ) : (
    ""
  );
};

export default Friendship;
